import "./Movie.css";
export default function Movie({
  movieOverview,
  movieRating,
  movieReleaseDate,
  moviePoster,
}) {
  return (
    <div
      style={{
        backgroudImage: `url(https://image.tmdb.org/t/p/w200/${moviePoster})`,
      }}
      className="movie"
    >
      <p className="movie-rating">{movieRating}</p>
      <p className="movie-release">{movieReleaseDate}</p>
      <p className="overview">{movieOverview}</p>
    </div>
  );
}
